import { createRouter, createWebHistory } from 'vue-router'
import Dashboard from '../views/adminDashboardBapenda.vue'
import Agenda from '../views/AgendaBapenda.vue'
// import Pegawai from '../views/PegawaiBapenda.vue'
// import Posisi from '../views/PosisiPegawai.vue'
import Department from '../views/DepartmentPegawai.vue'
import Kategori from '../views/KategoriAgenda.vue'
import Grafik from '../views/GrafikBapenda.vue'

const routes = [
  {
    path: '/',
    name: 'dashboard',
    component: Dashboard
  },
  {
    path: '/agendas',
    name: 'agendas',
    component: Agenda
  },
  {
    path: '/employees',
    name: 'employees',
    component: Pegawai
  },
  {
    path: '/positions',
    name: 'positions',
    component: Posisi
  },
  {
    path: '/departments',
    name: 'departments',
    component: Department
  },
  {
    path: '/categories',
    name: 'categories',
    component: Kategori
  },
  {
    path: '/charts',
    name: 'charts',
    component: Grafik
  },
]

const router = createRouter({
  history: createWebHistory(process.env.BASE_URL),
  routes
})

export default router
